import "../../styles/horizontalTable/table.scss"

export default class Table extends Component {
    constructor(props) {
        super(props);
    }
    redirect() {
        if (!this.props.redirectURL) return console.log("redirect !")
    }
    render() {
        return (
            <div>
                <div className="tableWrapper">
                    <table className="table">

