                                    <tr>
                                        <th>Name:</th>
                                        <td>Bill Gates</td>
                                    </tr>
                                )
                            })}
                        </tbody>
                        <thead>
                            <tr>
                                {this.props.columnHearder.map((headerName, title) => {
                                    return <th key={title}>{headerName}</th>
                                })}
                            </tr>
                        </thead>
                    </table>
                </div>
            </div>
        );
    }
}
